  return (
    <div class="mt-6 m-8 items-center text-xl" > 
        <div class="items-center text-xl" id="home_left">
                <p><h1>Hi, i'm</h1> </p>
                <p><h1 id="name">NDUBUISI AZI</h1></p>
                <p>I'm a UI/UX developer based in Atlanta GA</p>

                <p>I grew up in Philadelphia to a Nigerian father and Ugandan mother. 
                  I studied Finance at temple University. I spent some time living in NYC and San Francisco before moving to Atlanta.
                  I plan to start a career in tech.</p>

                  <p> Wish me luck!</p>
                  <image src="./photo1.png"></image>
                </div> 

    </div>      
  );
};

export default Applications;
